import react from 'react'

const MisinformationLink = function() {
    return (
        <a href="https://www.cdc.gov/vaccines/covid-19/health-departments/addressing-vaccine-misinformation.html" class="misinformation-link">Learn More About COVID-19 Misinformation</a>
    );
}

export default MisinformationLink;
